VError's constructor supports being called with no arguments (see here https://github.com/joyent/node-verror/blob/master/lib/verror.js#L63)

This is needed to be able to properly subclass a VError, e.g.

```typescript
class MyError extends VError {
    constructor(code: number, ...args) {
        super(...args) // this will not compile w/o this patch
    }
}
```

First off, the handler in join is optional, in which case an array is returned. Second of all, spread should preserve types from the previous promise. Basically this lets the following code work as expected:

```
return Promise.join("foo", 123, myPromiseReturningBool)
  .spread((fooValue, numberValue, boolValue) => {
    // with this change, fooValue is automatically typed as string,
    // numberValue as number, and boolValue as bool
  });
```

See: http://bluebirdjs.com/docs/api/promise.join.html, http://bluebirdjs.com/docs/api/spread.html
